import React from 'react';
import {Helmet} from 'react-helmet';

const Portfolio = () => {
    return (
        <React.Fragment>
        <Helmet>
        <title>Portfolio</title>
        </Helmet>
        <div>Portfolio page content here</div>
        </React.Fragment>
    );
}

export default Portfolio;
